colnames(coef_ac) <- c("(Intercept)","age","psa","race","priorbiopsy","dre","famhist.1","famhist.2","famhist.bca","prosvol","ari.use","hispanic","priorpsa")



# psa, age and race are mandatory, priorbiopsy, dre and famhistory are allowed missing
risk = function(age, psa, race, priorbiopsy, dre, famhist.1, famhist.2, famhist.bca, prosvol, ari.use, hispanic, priorpsa) {
  
  psa <- log(psa,2)
  if(!is.na(prosvol)){prosvol <- log(prosvol,2)}
  test <- c(age, psa, race, priorbiopsy, dre, famhist.1, famhist.2, famhist.bca, prosvol, ari.use, hispanic, priorpsa)
  
  # I used now the missing category in the box. If you use the "do not know" category, this part has just to be replaced by a = {race=="do not know"}.
  # age and psa are mandatory
  a = is.na(race)
  b = is.na(priorbiopsy)
  c = is.na(dre)
  d = is.na(famhist.1)
  e = is.na(famhist.2)
  f = is.na(famhist.bca)
  g = is.na(prosvol)
  h = is.na(ari.use)
  i = is.na(hispanic)
  j = is.na(priorpsa)
  
  sum(coef_ac[is.na(coef_ac[,"race"])==a&
                is.na(coef_ac[,"priorbiopsy"])==b&
                is.na(coef_ac[,"dre"])==c&
                is.na(coef_ac[,"famhist.1"])==d&
                is.na(coef_ac[,"famhist.2"])==e&
                is.na(coef_ac[,"famhist.bca"])==f&
                is.na(coef_ac[,"prosvol"])==g&
                is.na(coef_ac[,"ari.use"])==h&
                is.na(coef_ac[,"hispanic"])==i&
                is.na(coef_ac[,"priorpsa"])==j,-1]*
        test,
      na.rm=T)+
    coef_ac[is.na(coef_ac[,"race"])==a&
              is.na(coef_ac[,"priorbiopsy"])==b&
              is.na(coef_ac[,"dre"])==c&
              is.na(coef_ac[,"famhist.1"])==d&
              is.na(coef_ac[,"famhist.2"])==e&
              is.na(coef_ac[,"famhist.bca"])==f&
              is.na(coef_ac[,"prosvol"])==g&
              is.na(coef_ac[,"ari.use"])==h&
              is.na(coef_ac[,"hispanic"])==i&
              is.na(coef_ac[,"priorpsa"])==j,1] -> 
    risk.high
  
  ##### predicting probabilities
  risk.outcome=exp(risk.high)/(1+exp(risk.high))*100
  risk.outcome = min(100, round(risk.outcome))
  risk.outcome = c(100 - risk.outcome, risk.outcome)
  
  ##### Add Dimnames to Vector
  names(risk.outcome)=c('Other', 'Risk of High Grade Cancer')
  
  return(risk.outcome)
}
